import { createRouter, createWebHistory } from 'vue-router';
import Home from './components/views/Home.vue';
import EventDetails from './components/views/EventDetails.vue';

const routes = [
  { path: '/', component: Home },
  { path: '/event-details/:eventId', name: 'eventDetails', component: EventDetails },
  // ... other routes
];

const router = createRouter({
  history: createWebHistory(),
  routes
});

export default router;
